export type MablBrowserType = 'chrome' | 'firefox' | 'edge' | 'webkit';
export type MablTestResultOutcome = 'passed' | 'failed' | 'stopped';
export type MablTestResultStatus = 'completed' | 'failed' | 'running' | 'skipped';
export interface MablTestResult {
    workspace_id: string;
    started_time: number;
    completed_time: number;
    test_id?: string;
    test_ref_id?: string;
    test_labels?: string[];
    test_name?: string;
    test_type: 'browser';
    outcome: MablTestResultOutcome;
    status: MablTestResultStatus;
    parent_execution?: string;
    browser: MablBrowserType;
}
export type MablExecutionOutputStatus = 'passed' | 'failed' | 'skipped';
export interface MablExecutionOutput {
    status: MablExecutionOutputStatus;
    testObservations: MablExecutionObservation[];
    steps: MablExecutionStep[];
}
export type ObservationType = 'trace' | 'screenshot' | 'DOM' | 'console' | 'har' | 'log';
export type MablExecutionStepCategory = 'setup' | 'flow' | 'step' | 'internal' | 'unknown';
export interface MablExecutionStep {
    title: string;
    startTime: string;
    duration: number;
    status: 'passed' | 'failed' | 'skipped';
    error?: string;
    steps?: MablExecutionStep[];
    observations: MablExecutionObservation[];
    category: MablExecutionStepCategory;
    rawCategory: string;
}
export interface MablExecutionObservation {
    type: ObservationType;
    url: string;
}
